import React from 'react'


/************************************************
            [  Window  ]
************************************************/

window.addEventListener("load", (event) => {
    console.log("page is fully loaded");
  });


/************************************************
            [  Navigation bar: variables  ]
************************************************/
/************************************************
            [  Navigation bar: switcher  ]
************************************************/
export default function VL() {
  return (
    <>
    <div id="vlwrapper">
        <div id = "navbarwrap">
            <div id = "loginwrap">
                <p>login</p>
            </div>
            <ul>
                <li id="home-tab" className='navitems'>Home</li>
                <li id="service-tab" className='navitems'>Services</li>
                <li id="about-tab" className='navitems'>About us</li>
                <li id="contact-tab" className='navitems'>Contact</li>
            </ul>
        </div>
        <div id="homepage">

        </div>
    </div>
    </>
  )
}
